import React from "react";
import { BasicContentBox } from "../../pageframe/global/StyledComponents";
import { Typography, TextField } from "@material-ui/core";


export type SummarySectionData = {
    value: any
    label: string
}


interface Props {
    sectionHeader: string
    data: SummarySectionData[]
}

export const SummarySection: React.FC<Props> = (props) => {

  return (
    <BasicContentBox>
      <Typography variant="h2">
          {props.sectionHeader}
      </Typography>
      { props.data.map((d) => {
        return <TextField name={d.label}>
          {d.value}
        </TextField>
      })}

        <div>Product </div>
    </BasicContentBox>
  );
};
